CREATE DEFINER=`root`@`localhost` PROCEDURE `select_show`(
	theName varchar(100),
	movName varchar(100),
	stTime time, 
	endTime time,
    `day` varchar(100)
)
BEGIN
	-- SET THENAME VARCHAR(10);
